import{_ as a,c as t,a8 as o,o as r}from"./chunks/framework.CnRC9NRC.js";const c=JSON.parse('{"title":"Support","description":"","frontmatter":{},"headers":[],"relativePath":"en/about/support.md","filePath":"en/about/support.md"}'),i={name:"en/about/support.md"};function s(l,e,n,h,u,d){return r(),t("div",null,e[0]||(e[0]=[o('<h1 id="support" tabindex="-1">Support <a class="header-anchor" href="#support" aria-label="Permalink to &quot;Support&quot;">​</a></h1><h2 id="mailing-list-discussion" tabindex="-1">Mailing List/Discussion <a class="header-anchor" href="#mailing-list-discussion" aria-label="Permalink to &quot;Mailing List/Discussion&quot;">​</a></h2><p>The core development team and community are active on the <a href="https://groups.google.com/forum/#!forum/mavlink" target="_blank" rel="noreferrer">mailing list</a>.</p><h2 id="reporting-bugs-issues" tabindex="-1">Reporting Bugs &amp; Issues <a class="header-anchor" href="#reporting-bugs-issues" aria-label="Permalink to &quot;Reporting Bugs &amp; Issues&quot;">​</a></h2><p>If you have any problems using MAVLink first post them on the <a href="https://groups.google.com/forum/#!forum/mavlink" target="_blank" rel="noreferrer">mailing list</a>.</p><p>If directed by the development team, issues may be raised on <a href="https://github.com/mavlink/mavlink/issues" target="_blank" rel="noreferrer">Github here</a>.</p><h2 id="dev_call" tabindex="-1">Dev Call <a class="header-anchor" href="#dev_call" aria-label="Permalink to &quot;Dev Call {#dev_call}&quot;">​</a></h2><p>MAVLink developers, adopting companies and the surrounding community of users meet regularly to help define the direction of the project, discuss RFCs, Issues and have a Q&amp;A session.</p><div class="tip custom-block github-alert"><p class="custom-block-title">TIP</p><p>The call is open to anyone who wants to contribute to the ongoing development of the project (not just the dev team). This is a great opportunity to meet the team.</p></div><h4 id="who-should-attend" tabindex="-1">Who should attend: <a class="header-anchor" href="#who-should-attend" aria-label="Permalink to &quot;Who should attend: {#who-should-attend}&quot;">​</a></h4><ul><li>Core project maintainers</li><li>Component maintainers</li><li>Dronecode members</li><li>Community members</li><li>Anyone interested in the development of MAVLink</li></ul><h4 id="agenda" tabindex="-1">Agenda <a class="header-anchor" href="#agenda" aria-label="Permalink to &quot;Agenda&quot;">​</a></h4><p>Meeting agenda (and historical meeting minutes) are available on the <a href="https://github.com/mavlink/mavlink/wiki#weekly-meetingsagendas" target="_blank" rel="noreferrer">MAVLink wiki here</a>.</p><ul><li>Add topics that you&#39;d like to discuss and issues you&#39;d like to unblock.</li><li><strong>Nominate Issues and PRs</strong> for the call with the <a href="https://github.com/mavlink/mavlink/labels/Dev%20Call" target="_blank" rel="noreferrer"><strong>Dev Call</strong></a> label on Github.</li></ul><h4 id="schedule" tabindex="-1">Schedule <a class="header-anchor" href="#schedule" aria-label="Permalink to &quot;Schedule {#schedule}&quot;">​</a></h4><p>There is a recurring bi-weekly call which covers Asia-Europe overlap (there is also a reserved call slot for a Europe-Americas overlap on PST timezone that can be used when needed).</p><ul><li><strong>Call:</strong> <a href="https://meet.jit.si/mavlink" target="_blank" rel="noreferrer">https://meet.jit.si/mavlink</a></li><li><strong>Time:</strong> See <a href="https://www.dronecode.org/calendar/" target="_blank" rel="noreferrer">Dronecode calendar</a></li></ul>',17)]))}const m=a(i,[["render",s]]);export{c as __pageData,m as default};
